import { Component } from "@angular/core";
import { HttpClient } from '@angular/common/http';
import { GetBreedsService } from "src/app/shared/services/getBreeds.service";


@Component({
  selector: "app-breeds-list",
  templateUrl: "./breeds-list.component.html",
  styleUrls: ["./breeds-list.component.scss"],
})
export class BreedsListComponent {
  breeds: any;

  constructor(private http: HttpClient, getBreedService: GetBreedsService) {
    this.breeds = getBreedService.getBreeds();
  }

  public getPrevious(){
    this.breeds = this.breeds.prev_page_url;
  }

  public getNext(){
    this.breeds = this.breeds.next_page_url;
  }
}
